import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  Redirect,
} from "react-router-dom";
import InfoNavBar from "../infocomponents/InfoNavBar";

function Information() {
  return (
    <>
      <Router>
          <InfoNavBar />

          <Switch>
            <Route path="">

            </Route>
          </Switch>

        <h1>Information</h1>
      </Router>
    </>
  );
}

export default Information;
